{
  "message_name": "UBX-NAV-EOE",
  "message_class_id": "0x01",
  "message_id": "0x61",
  "message_type": "periodic",
  "description": "End of epoch. This message is intended to be used as a marker to collect all navigation messages of an epoch. It is output after all enabled NAV class messages (except UBX-NAV-HNR) and after all enabled NMEA messages.",
  "payload_length": {
    "fixed": 4
  },
  "payload_fields": [
    {
      "byte_offset": 0,
      "data_type": "U4",
      "name": "iTOW",
      "unit": "ms",
      "description": "GPS time of week of the navigation epoch. See section iTOW timestamps in the integration manual for details."
    }
  ]
}
